import React from "react";
import {
    Box,
    Center,
    Flex,
    Checkbox,
    Stack,
    Heading,
    Text,
} from "@chakra-ui/react";

const Quiz = () => {
    return (
        <Box w={"100%"} p={"20px"}>
            <Center h={"100%"}>
                <Flex w={"70%"} direction={"column"}>
                    {[1, 1, 2, 3, 3].map((item) => (
                        <Box pb={5}>
                            <Text fontSize="xl">This is message 1</Text>
                            <Stack spacing={2} direction={"column"}>
                                <Checkbox colorScheme="red" defaultIsChecked>
                                    Checkbox
                                </Checkbox>
                                <Checkbox colorScheme="green" defaultIsChecked>
                                    Checkbox
                                </Checkbox>
                            </Stack>
                        </Box>
                    ))}
                </Flex>
            </Center>
        </Box>
    );
};

export default Quiz;
